import React from 'react';
import { createStackNavigator } from '@react-navigation/stack';
import IndexScreen from '../screens/IndexScreen';
import CreateScreen from '../screens/CreateScreen';
import EditScreen from '../screens/EditScreen';
import ShowScreen from '../screens/DetailsScreen';
import { lightStyles } from '../styles/commonStyles';

const InnerStack = createStackNavigator();

export default function BlogStack() {

  const styles = lightStyles
  const headerOptions = {
    headerStyle: styles.header,
    headerTitleStyle: styles.headerTitle,
    headerTintColor: styles.headerTint
  }

  return (
    <InnerStack.Navigator>
      <InnerStack.Screen name="Index" component={IndexScreen} options={{ title: "Task Lists", ...headerOptions, headerLeft: null }} />
      <InnerStack.Screen name="Add" component={CreateScreen} options={{ title: "Add Task", ...headerOptions }} />
      <InnerStack.Screen name="Details" component={ShowScreen} options={headerOptions} />
      <InnerStack.Screen name="Edit" component={EditScreen} options={{ title: "Edit Task", ...headerOptions }} />
    </InnerStack.Navigator>
  )
}
